measurements.description:
Two striking flowers and three buds on one staked, 64-cm inflorescence;
 dorsal sepal narrowly deltoid, basal margin strongly recurved,
 apical margin incurved, cream-yellow,
 overlaid light green veins, darker centrally;
 synsepal elliptic, cream-yellow, overlaid light green veins;
 petals narrowly spatulate, twisting forward apically, cream-yellow,
 overlaid light green veins, blushed lavender apically;
 pouch light green, darker green veins, light lavender blush laterally;
 staminode pale yellow, light green centrally;
 substance firm; texture satin, pouch waxy.
